    //检测
    detection(){
        var num_row = 1
        var num_col = 1
        var row = []
        var col = []
       
        for (let i = 0; i < pic.length; i++) {
            for (let j = 0; j < pic[0].length; j++) {
               if(j>=2){
                   left(i,j)
               }
               if(i>=2){
                   up(i,j)
               }           
            }            
        }
        

        clear_repeat()

        

        //检测行
        function left (m,n) {
            if(n == 0 || pic[m][n].texture.key != pic[m][n-1].texture.key ){
                if(num_row>=3){
                    if(row.length > 0){
                        if(row[row.length-1].key == pic[m][n].texture.key && row[row.length-1].index.j == n){
                            row.pop()
                            row.push({
                                key:pic[m][n].texture.key,
                                nums:num_row,
                                index:{i:m,j:n},
                                repeat:(function () {
                                    var arr_n = []
                                    for (let i = 1; i <= num_row; i++) {
                                        arr_n.push({i:m,j:n})
                                        n++
                                    }
                                    return arr_n
                                })(),
                            })
                        }else{
                            row.push({
                                key:pic[m][n].texture.key,
                                nums:num_row,
                                index:{i:m,j:n},
                                repeat:(function () {
                                    var arr_n = []
                                    for (let i = 1; i <= num_row; i++) {
                                        arr_n.push({i:m,j:n})
                                        n++
                                    }
                                    return arr_n
                                })(),
                            })
                        }
                    }else{
                        row.push({
                            key:pic[m][n].texture.key,
                            nums:num_row,
                            index:{i:m,j:n},
                            repeat:(function () {
                                var arr_n = []
                                for (let i = 1; i <= num_row; i++) {
                                    arr_n.push({i:m,j:n})
                                    n++
                                }
                                return arr_n
                            })(),
                        })
                    }

                    num_row = 1

                    return
                    
                }else{
                    num_row = 1
                    return 1
                }
            }
            if(pic[m][n].texture.key == pic[m][n-1].texture.key && n>0){
                num_row++
                return left(m,n-1)
            }
        }

        //检测列
        function up (m,n) {
            if(m == 0 || pic[m][n].texture.key != pic[m-1][n].texture.key ){
                if(num_col>=3){
                    if(col.length>0){
                        for (let i = 0; i < col.length; i++) {
                            if(col[i].key == pic[m][n].texture.key && col[i].index.i == m){
                                col.splice(i,1)
                            }                            
                        }
                        col.push({
                            key:pic[m][n].texture.key,
                            nums:num_col,
                            index:{i:m,j:n},
                            repeat:(function () {
                                var arr_n = []
                                for (let i = 1; i <= num_col; i++) {
                                    arr_n.push({i:m,j:n})
                                    m++
                                }
                                return arr_n
                            })(),
                        })
                    }else{
                        col.push({
                            key:pic[m][n].texture.key,
                            nums:num_col,
                            index:{i:m,j:n},
                            repeat:(function () {
                                var arr_n = []
                                for (let i = 1; i <= num_col; i++) {
                                    arr_n.push({i:m,j:n})
                                    m++
                                }
                                return arr_n
                            })(),
                        })
                    }

                    num_col = 1

                    return
                    
                }else{
                    num_col = 1
                    return 1
                }
            }
            if(pic[m][n].texture.key == pic[m-1][n].texture.key && m>0){
                num_col++
                return up(m-1,n)
            }
        }

        //处理行列数组中的重复
        function clear_repeat(drag) {
            //添加五个以上重复的生成道具的坐标
            for (let i = 0; i < row.length; i++) {
                for (let j = 0; j < row[i].repeat.length; j++) {
                    for (let m = 0; m < col.length; m++) {
                        for (let n = 0; n < col[m].repeat.length; n++) {
                            if(row[i].repeat[j].i == col[m].repeat[n].i && row[i].repeat[j].j == col[m].repeat[n].j){
                                tools.five.push(col[m].repeat[n])
                            }
                        }
                    }
                }
            }

            //添加四个的重复坐标
            for (let i = 0; i < row.length; i++) {
                 if(row[i].nums >= 4){
                     if(tools.five.length>0){
                        for (let j = 0; j < tools.five.length; j++) {
                            if(row[i].index.i != tools.five[j].i || row[i].index.j != tools.five[j].j){
                                tools.four.row.push({i:row[i].index.i,j:row[i].index.j,key:row[i].key,nums:row[i].nums})
                            }
                        }
                     }else{
                        tools.four.row.push({i:row[i].index.i,j:row[i].index.j,key:row[i].key,nums:row[i].nums})
                     }
                 }               
            }
            for (let i = 0; i < col.length; i++) {
                if(col[i].nums >= 4){
                    if(tools.five.length>0){
                       for (let j = 0; j < tools.five.length; j++) {
                           if(col[i].index.i != tools.five[j].i || col[i].index.j != tools.five[j].j){
                               tools.four.col.push({i:col[i].index.i,j:col[i].index.j,key:col[i].key,nums:col[i].nums})
                           }
                       }
                    }else{
                       tools.four.col.push({i:col[i].index.i,j:col[i].index.j,key:col[i].key,nums:col[i].nums})
                    }
                }               
           }

            //添加要清除的坐标
            for (let i = 0; i < row.length; i++) {
                for (let j = 0; j < row[i].repeat.length; j++) {
                    pos_clear.push(row[i].repeat[j])
                }
            }
            for (let i = 0; i < col.length; i++) {
                for (let j = 0; j < col[i].repeat.length; j++) {
                    pos_clear.push(col[i].repeat[j])
                }
            }
            console.log(row,col)
            console.log(pos_clear)
            console.log(tools)
            if(pos_clear.length>0){
                for (let i = 0; i < pos_clear.length; i++) {
                    for (let j = 0; j < tools.five.length; j++) {
                        if(pos_clear[i].i == tools.five[j].i && pos_clear[i].j == tools.five[j].j){
                            pos_clear.splice(i,1)
                        }
                    }
                }
                for (let i = 0; i < tools.five.length; i++) {
                    pos_clear.push(tools.five[i])                
                }
            }
            
        }

    }


