    star(x,y,letter){
        var color
        switch (letter) {
            case 'red':
                color = 'red_p'
                break;
            case 'pink':
                color = 'red_p'
                break;
            case 'green':
                color = 'green_p'
                break;
            case 'yellow':
                color = 'yellow_p'
                break;
            case 'blue':
                color = 'blue_p'
                break;
            default:
                break;
        }
        var emitter0 = this.add.particles(color).setDepth(5).createEmitter({
            x: x,
            y: y,
            speed: {
                min: 0,
                max: 600
            },
            angle: {
                min: 0,
                max: 360,
                steps: 15
            },
            scale: {
                start: 0.5,
                end: 0
            },
            // blendMode: 'SCREEN',
            //active: false, 
            lifespan: 400,
            // gravityY: 800,
            quantity: 5,
            blendMode: 'ADD'
        });
        // emitter0.setDepth(3)
        // console.log(emitter0)
        setTimeout(() => {
            emitter0.explode();
            // emitter1.explode();
        }, 100)
    }
    star_ball(x1,y1,x2,y2,key){
        var line = new Phaser.Geom.Line(x1, y1, x2, y2)
        if(key == 'pink'){
            key = 'red'
        }
        var name = this.add.particles(key+'_p').createEmitter({
            // x: x1,
            // y: y1,
            blendMode: 'ADD',
            scale: { start: 0.1, end: 0.1 },
            // speed: 200,
            // angle: 425,
            lifespan:100,
            depth:2,
            // moveToX:x2,
            // moveToY:y2,
            quantity: 0,
            // frequency: 1,
            emitZone: { type: 'edge', source: line, quantity: 100}
        });
        // console.log(line)
        return name
    }
